import React from 'react';
import NavBarLeft from './NavBarLeft';
import NavBarRight from './NavBarRight';
import './NavBar.css';
import NavBarMobileMenu from './NavBarMobile/NavBarMobile';
import { useNavigate, useLocation } from 'react-router-dom';
import Logo from '../../assets/NavBarLogo.svg';

const NavBar: React.FC = () => {
	const navigator = useNavigate();
	const location = useLocation();
	const message = location.state?.message;
	function closeButton(): void {
		const messageDiv = document.getElementById('welcomeMessage');
		if (messageDiv) {
			messageDiv.style.display = 'none'; // Change the display to 'none'
			sessionStorage.clear();
		}
	}
	return (
		<div id="navbar">
			<NavBarLeft />
			<NavBarMobileMenu />
			<img
				alt="mobile logo"
				className="mobile-logo"
				src={Logo}
				onClick={() => {
					navigator('/');
				}}
			/>
			{message && (
				<div id="welcomeMessage">
					<div
						id="log-out"
						onClick={() => closeButton()}
						className="log-out">
						log out
					</div>
					<div> {message}</div>
				</div>
			)}
			<NavBarRight />
		</div>
	);
};

export default NavBar;
